import {useFormik} from "formik";

const Login = () => {
    return <div>
        <form>
            <label htmlFor={'email'}>Email</label>
            <br/>
            <input type={'email'} id={'email'} name={'email'}/>
            <br/>


            <label htmlFor={'password'}>Password</label>
            <br/>
            <input type={'password'} id={'password'} name={'password'}/>
        </form>
    </div>
};
export default Login;
